import './styles/App.css';


function App() {
  return (
    <div className="App">
      <Header />




      <BrowserRouter>
        <Routes>
          <Route element={<Home />} path="/" default />
          <Route element={<Contact />} path="/contact" default />
          <Route element={<Thankyou />} path="/thankyou" default />
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
